import pages.data as datafrom pages.login_page import Login_pageclass TestUserAccountPage:    def test_transition_to_user_account(self, driver, login, password):        user_account_page = Login_page(driver, data.url)        driver.get(data.url)        user_account_page.click_user_acc_btn()        user_account_page.fill_inputs_login(login, password)        user_account_page.click_login_btn()        user_account_page.click_user_acc_btn()        user_account_page.assert_url(f'{data.url}account/profile')    def test_transition_from_user_account_click_to_constructor(self, driver):        user_account_page = Login_page(driver, data.url)        user_account_page.click_designer()        user_account_page.assert_url(data.url)    def test_transition_from_user_account_click_to_logo(self, driver):        user_account_page = Login_page(driver, data.url)        user_account_page.click_user_acc_btn()        user_account_page.click_logo()        user_account_page.assert_url(data.url)